import { Component } from "react"
import { motion } from "framer-motion";

class Other extends Component {

    render() {
        return (
            <motion.div
            exit={{opacity: 0}}
            animate={{opacity: 1}}
            initial={{opacity: 1}}
            >
                HAHA
            </motion.div>
        )
    }

}

export default Other;
